1、Der Erfahrungscoupon muss innerhalb der gültigen Frist verwendet werden;
2、Gutscheine für die Erfahrung können nur bei Positionen-Building-Transaktionen verwendet werden;
3、Bei der Nutzung von Erfahrungsgutscheinen zur Erstellung von Dokumenten ist keine Bearbeitungsgebühr zu entrichten;
4、Bei der Erstellung eines Dokuments mit Erfahrungsgutscheinen muss die Anzahl der Bestellungen mit der Anzahl der Erfahrungsgutscheine übereinstimmen;
5、Wird die Bestellung mit Experience Coupon geschlossen, wenn sie gewinnbringend ist, gehört der Gewinnanteil dem Nutzer; Wenn es einen Verlust gibt, hat der Benutzer keinen Verlust
